import React, { useState } from 'react';
import '../css/Login.css';
import logo from '../img/logo.png';
import { useNavigate } from 'react-router-dom';

function Login() {
  const navigate = useNavigate();

  const [selectedRow, setSelectedRow] = useState(null);

  const [selectedButton, setSelectedButton] = useState(null);
  const [username, setUsername] = useState('');
  const [password, setPassword] = useState('');

  const handleButtonClick = (buttonName) => {
    setSelectedButton(buttonName);
  };

  const handleLogin = () => {
    if (username === 'admin' && password === 'admin') {
      // Redirecionar para a página do administrador
      window.location.href = '/admin-page';
    } else {
      // Verificar qual botão está selecionado e redirecionar para a página correspondente
      if (selectedButton === 'Locadora') {
        window.location.href = '/locadora-page';
      } else if (selectedButton === 'Locatário') {
        window.location.href = '/locatario-page';
      }
    }
  };

  return (
    <div className="Login">
      <header className="Login-header">
        <table>
          <tbody>
            <tr>
              <td colSpan="2">
                <img src={logo} className="rentfyLogoLogin" alt="logo" />
              </td>
            </tr>
            <tr>
              <td>
                <fieldset className="fieldset-custom">
                  <legend>Login</legend>
                  <div>
                    <button
                      onClick={() => handleButtonClick('Locadora')}
                      style={{ backgroundColor: selectedButton === 'Locadora' ? 'rgba(102, 192, 117, 1)' : 'initial' }}
                    >
                      Locadora
                    </button>
                    <button
                      onClick={() => handleButtonClick('Locatário')}
                      style={{ backgroundColor: selectedButton === 'Locatário' ? 'rgba(102, 192, 117, 1)' : 'initial' }}
                    >
                      Locatário
                    </button>
                  </div>
                  <form id="Login">
                    
                    <div className="form-group">
                      <button className="btnLogin">Reservar Imóvel</button>
                    </div>
                  </form>
                </fieldset>
              </td>
            </tr>
          </tbody>
        </table>
      </header>
    </div>
  );
}

export default Login;
